doc.problem:
Side $CD$ of rectangle $ABCD$ measures 12 meters, as shown. Each of the three triangles with a side along segment $CD$ is an equilateral triangle. What is the total area of the shaded regions? Express your answer in simplest radical form. [asy]
import olympiad; size(150); defaultpen(linewidth(0.8));
fill((2,2*sqrt(3))--(4,0)--(6,2*sqrt(3))--cycle^^(6,2*sqrt(3))--(8,0)--(10,2*sqrt(3))--cycle,gray(0.7));
draw((0,0)--(12,0)--(12,2*sqrt(3))--(0,2*sqrt(3))--cycle);
draw((0,0)--(2,2*sqrt(3))--(4,0)--(6,2*sqrt(3))--(8,0)--(10,2*sqrt(3))--(12,0));
label("$A$",(0,2*sqrt(3)),NW); label("$B$",(12,2*sqrt(3)),NE); label("$C$",(12,0),SE); label("$D$",(0,0),SW);
draw("12 meters", (0,2*sqrt(3) + 1)--(12,2*sqrt(3) + 1),N);
[/asy]

doc.solution:
The two right triangles on the ends of the rectangle can be pushed together to form an equilateral triangle that is identical to each of the other equilateral triangles in the diagram.  So, $AB$ is equal to the total length of 3 side lengths of an equilateral triangle.  Therefore, each side of each equilateral triangle has length $12/3 = 4$.  Therefore, our problem is to find the total area of two equilateral triangles with side length 4.

Drawing an altitude of an equilateral triangle splits it into two 30-60-90 right triangles: [asy]
unitsize(0.6inch);
pair A, B, C, F;
A = (0,1);
B = rotate(120)*A;
C = rotate(120)*B;
F = foot(A,B,C);
draw(A--B--C--A,linewidth(1));
draw(A--F);
[/asy]

An altitude of an equilateral triangle is therefore $\sqrt{3}$ times the length of half the side length of the triangle.  Therefore, an equilateral triangle with side length 4 has altitude length $\sqrt{3}(4/2) = 2\sqrt{3}$, and area $(2\sqrt{3})(4)/2 = 4\sqrt{3}$ square units.  The shaded regions consist of two of these equilateral triangles, so their total area is $2(4\sqrt{3}) = \boxed{8\sqrt{3}}$.

The diagram on the left shows the path of Bill's walk. As the diagram on the right illustrates, he could also have walked from $A$ to $B$ by first walking 1 mile south then $\frac{3}{4}$ mile east. [asy]
pair a=(0,1), b=(.75, 0), c=(0,.5), d=(.75,.5), o=(0,0);
draw(a--b--d--c--cycle);
label("$A$", a, NW);
label("$B$", b, SE);
label("$\frac{1}{2}$", (0,0.75), W);
label("$\frac{3}{4}$", (.7, 0.66),W);
label("$\frac{1}{2}$", (.75, .25), E);

picture pic;
draw(pic, a--b--o--cycle);
label(pic, "$A$", a, NW);
label(pic, "$B$", b, SE);
label(pic, "$\frac{3}{4}$", (.375,0), S);
label(pic, "1", (0, .5), W);
add(shift(1.5,0)*pic);
[/asy] By the Pythagorean Theorem, \[(AB)^2=1^2+\left(\frac{3}{4}\right)^2=1+\frac{9}{16}=\frac{25}{16},\]so $AB=\frac{5}{4}=1\frac{1}{4}$, or $\boxed{1.25}$.

\begin{align*}
\frac{\sqrt{24}}{\sqrt{30}}\div\frac{\sqrt{20}}{3\sqrt{25}}&=\frac{\sqrt{24}}{\sqrt{30}}\times \frac{3\sqrt{25}}{\sqrt{20}}\\
&=\frac{2\sqrt{6}}{\sqrt{5}\times \sqrt{6}}\times\frac{15}{2\sqrt{5}}\\
&=\boxed{3}
\end{align*}

Notice that the two fractions have the same denominator, so we can add them. Addition is commutative, so we can rearrange the terms to get  \begin{align*}
\frac{k-3}{2} +\frac{3k+1}{2}+3k+1 &=\frac{4k-2}{2}+3k+1 \\
&=2k-1+3k+1 \\
&=\boxed{5k}.\end{align*}

